import { Fragment } from "react";
import AvailableMeals from "./AvailableMeals";
import Images from "./MealItem/Images";
import classes from "./TotalCocktail.module.css";

const TotalCocktail = (props) => {
  return (
    <div className={classes.container}>
      <Images />
      <AvailableMeals />
    </div>
  );
};

export default TotalCocktail;
